t.exports='---changelog---\ndate: "2023-01-25"\nlocale: "en-US"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNew Year, More Bug Bashing {added marginTop}\n======================\n\nTwas the night before New Years and all through the Discord house, all the creatures were stirring and those creatures were bugs. Poetry isn’t our specialty, but bug bashing is. We are ringing in the new year with the extermination of around 100 Discord bugs, with what we’re calling the Great Discord Bug Bash!\n\n**Lightened up Light bugs.** Let’s shine some light on how we lightened up Light Theme. In light of some discoveries, like a dark spot here or the wrong icon color there, we decided to fix those and bring some more light to Light Theme. This ought to enlighten the great debate of which theme is better. \n\n**Less messed up text chat.** Wumpus and the gang solved the mystery of the missing words. Sometimes words just disappeared when you sent them, which is of course less than ideal. So we fixed that and 20 other text-related errors like GIFs autoplaying correctly in forums, and now you can actually search text in a voice chat. \n\n**Streamlined Streamer Mode.** Turning on Streamer Mode now hides both User Profiles and Server Profiles so you can give full attention to your adoring fans. We love that you love your face and going on camera is great, especially now that we fixed some bugs with the camera preview permissions. \n\n**Discord go brrrr.** We’ve got a need, a need for speed so we made the app open faster and now you can get to more of the stuff you like in record time.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "de"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNeues Jahr, mehr Bug Bashing {added marginTop}\n======================\n\nEs war die Nacht vor Neujahr und im ganzen Discord-Haus regten sich alle Kreaturen und diese Kreaturen waren Bugs. Poesie ist nicht unser Steckenpferd, aber Bug Bashing schon. Wir läuten das neue Jahr mit der Vernichtung von etwa 100 Discord-Bugs mit dem ein, was wir den großen Discord Bug Bash nennen!\n\n**Aufgehellte Light-Bugs.** Lasst uns etwas Licht darüber ins Dunkel bringen, wie wir das helle Schema aufgehellt haben. Nach einigen Entdeckungen, wie z. B. einem dunklen Fleck hier oder der falschen Symbolfarbe dort, haben wir beschlossen, diese zu beheben und mehr Licht ins helle Schema zu bringen. Das sollte die große Debatte darüber, welches Schema besser ist, erhellen. \n\n**Weniger Durcheinander im Text-Chat.** Wumpus und die Bande haben das Geheimnis der fehlenden Wörter gelöst. Manchmal verschwanden Wörter einfach, wenn du sie gesendet hast, was natürlich nicht ideal ist. Also haben wir das und 20 andere textbezogene Fehler behoben, wie z. B. dass GIFs in Foren automatisch richtig abgespielt werden, und jetzt kannst du tatsächlich nach Text in einem Sprach-Chat suchen. \n\n**Verbesserter Streamer-Modus.** Wenn du den Streamer-Modus aktivierst, werden jetzt sowohl die Benutzer- als auch die Serverprofile ausgeblendet, damit du dich voll und ganz deinen Fans widmen kannst. Wir lieben es, dass du dein Gesicht liebst, und vor die Kamera zu treten ist großartig, besonders jetzt, wo wir einige Fehler mit den Berechtigungen für die Kameravorschau behoben haben. \n\n**Discord go brrrr.** Wir haben ein Bedürfnis, ein Bedürfnis nach Geschwindigkeit, also haben wir dafür gesorgt, dass sich die App schneller öffnet und du jetzt in Rekordzeit zu mehr von dem gelangen kannst, was du magst."\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "es-ES"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nAño nuevo, misma lucha contra bugs {added marginTop}\n======================\n\nFue la noche antes del Año Nuevo, cuando en toda la casa de Discord, muchas criaturas se agitaban; esas criaturas eran bugs. La poesía no es nuestro fuerte, pero la lucha contra los fallos sí que lo es. Vamos a celebrar el nuevo año con el exterminio de alrededor de 100 fallos comunes en la aplicación, ¡algo que llamamos «El gran exterminio de bugs en Discord»!\n\n**Fallos de luz reducidos.** Vamos a arrojar algo de luz sobre cómo hemos mejorado el modo claro. A la luz de algunos descubrimientos, como una mancha oscura aquí o un color de icono incorrecto allá, hemos decidido hacer correcciones y abrillantar el tema claro. Esto debería arrojar también algo de luz sobre el gran debate de qué tema es mejor.\n\n**Chat de texto mejorado.** Wumpus y su pandilla han resuelto el misterio de las palabras desaparecidas. En ocasiones, algunas de ellas no se mostraban cuando las enviabas; algo que, por supuesto, no es normal. Por eso, hemos solucionado ese y otros 20 errores relacionados con el texto, como que los GIF que se reproduzcan automáticamente de forma correcta en los foros, y que ahora se pueda buscar texto en un chat de voz.\n\n**Modo de transmisión simplificado.** Ahora, al activar el modo de transmisión, se ocultan los perfiles de usuario y de servidor para que puedas prestar toda tu atención a tus admiradores. Somos muy fans de que te encante tu rostro, así que estar frente a la cámara ahora será aún más genial, ya que hemos solucionado algunos errores con los permisos de vista previa de la cámara.\n\n**Discord pisa el acelerador.** Somos rápidos y furiosos, así que hemos conseguido que ahora la aplicación se abra más rápido, para que puedas acceder a todas las cosas que te gustan en un tiempo récord.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "fr"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNouvelle année, plus de bugs à écraser {added marginTop}\n======================\n\nLa veille du Nouvel An, dans toute la maison Discord, les êtres bougeaient tous et ces derniers étaient des bugs. Bon, la poésie ce n’est pas notre point fort, mais écraser des bugs l’est. On fête le nouvel an avec l’extermination d’environ 100 bugs Discord, une initiative appelée « La Grande Chasse aux Bugs Discord » !\n\n**Mettre les bugs au clair.** Faisons la lumière sur comment on a éclairci le Thème Clair. À la lumière de certaines découvertes, tels qu’un point sombre par ici ou une mauvaise couleur pour une icône par là, on a décidé de corriger ces choses et illuminer un peu plus le Thème Clair. Ceci devrait éclairer le débat sur quel thème est le meilleur. \n\n**Mettre de l’ordre dans le chat textuel.** Wumpus et sa bande d’amis ont résolu le mystère des mots manquants. Parfois les mots disparaissaient lorsque vous les envoyiez, ce qui bien évidemment est loin d’être idéal. On a donc corrigé cela, ainsi que 20 autres erreurs liées au texte comme les GIFs qui devraient bien s’animer automatiquement dans les forums. Et maintenant vous pouvez vraiment rechercher du texte dans un chat vocal. \n\n**Un mode streamer simplifié.** L\'activation du mode streamer masque désormais les profils utilisateur et les profils de serveur afin que vous puissiez accorder toute votre attention à vos fans en adoration. On aime que vous aimiez votre visage, et on trouve aussi que se mettre devant la caméra c’est génial, surtout maintenant qu’on a corrigé quelques bugs pour les permissions concernant l’aperçu de la caméra. \n\n**Discord qui carbure.** La vitesse, c’est un peu notre truc. On a donc fait en sorte que l’application s’ouvre plus rapidement et vous pouvez maintenant accéder à plus de choses que vous aimez en un temps record.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "it"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNuovo anno, meno bug {added marginTop}\n======================\n\nEra la notte prima di Capodanno e in tutta la casa di Discord, tutte le creature si stavano agitando e quelle creature erano bug. La poesia non è la nostra specialità, ma l\'eliminazione dei bug lo è. Stiamo salutando il nuovo anno con lo sterminio di circa 100 bug di Discord, con quello che chiamiamo Great Discord Bug Bash!\n\n**Bug leggeri, alleggeriti** Facciamo luce su come abbiamo alleggerito il Tema Chiaro. Alla luce di alcune scoperte, come una macchia scura qui o il colore sbagliato dell\'icona là, abbiamo deciso di correggerle e portare un po\' più di luce a questo Tema. Questo dovrebbe aiutare il grande dibattito su quale sia il Tema migliore da utilizzare.\n\n**Chat di testo meno caotica.** Wumpus e la banda hanno risolto il mistero delle parole mancanti. A volte le parole semplicemente scompaiono quando vengono ascoltate, il che ovviamente non è ideale. Quindi abbiamo corretto questo e altri 20 bug relativi al testo come le GIF che si riproducono automaticamente nei forum e ora è possibile cercare effettivamente il testo in una chat vocale.\n\n**Modalità streamer semplificata.** l\'attivazione della modalità streamer ora nasconde sia i profili utente che i profili server in modo da poter prestare la massima attenzione ai tuoi fan adoranti. Ci piace sapere che ami presentarti davanti alla fotocamera, è fantastico, soprattutto ora che abbiamo corretto alcuni bug con le autorizzazioni di anteprima per la webcam.\n\n**Discord go brrrr.** Abbiamo un bisogno, un bisogno di velocità, quindi abbiamo fatto in modo che l\'app si aprisse più velocemente e ora puoi accedere a tutte le cose che ti piacciono in tempi record.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "ja"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\n新年の虫退治  {added marginTop}\n======================\n\n\nそれは新年の前夜のことです。Discordの家中に虫（バグ）が蠢いていました。\nポエムは私たちの専門ではありませんが、虫退治ならお手の物です。\nそのため、私たちは約100匹のバグを駆除し、新年を迎えることになりました。\n\n\n**光る虫を照らしてみた**ライトテーマを例に取ってみましょう。ここ暗いよねとか、アイコンの色違うでしょとか、そういうのがあったので修正しました。これによってどのテーマが優れているかという議論に燃料を投下しました。\n\n**テキストチャットをスッキリと**ワンパスとその仲間たちが消えた文字の謎を解きました。送信時に単語が消えてしまうことが時々ありましたが、こんなことはもちろん理想的ではありません。また、フォーラムでGIFが正しく自動再生されるようにするなど、テキストに関する20個ものエラーを修正し、さらにボイスチャットでテキスト検索も出来るようにしました。\n\n**洗練された配信者モード** 配信者モード*をオンにするとユーザープロフィールとサーバーフィールの両方が非表示になるので、熱烈なファンに集中することができるようになりました。あなたの顔を愛してるあなたを、カメラ大好きなあなたのことを、私たちは愛しています。カメラプレビューの許可に関するいくつかのバグを修正しておきましたよ。\n\n**Discord ゴオオオオ** 私たちにはニーズがあります。スピードが求められているのです。そのためアプリを開く速度を上げました。これにより、あなたが大好きなものにアクセスする時間は新記録を出すことでしょう。\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "nl"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNieuw jaar, meer bugbashing {added marginTop}\n=====================\n\nTwas de nacht voor nieuwjaar en door het hele Discord-huis, waren alle wezens in beweging en die wezens waren bugs. Poëzie is niet onze specialiteit, maar bug bashen wel. We luiden het nieuwe jaar in met de uitroeiing van ongeveer 100 Discord-bugs, met wat we de Great Discord Bug Bash noemen!\n\n**Light bugs verlicht.** Laten we eens kijken hoe we Light Theme hebben verlicht. In het licht van enkele ontdekkingen, zoals een donkere vlek hier of de verkeerde kleur van het pictogram daar, hebben we besloten deze op te lossen en wat meer licht te brengen in Light Theme. Dit zou het grote debat moeten verlichten over welk thema beter is.\n\n**Minder rommelige tekstchat.** Wumpus en de bende hebben het mysterie van de ontbrekende woorden opgelost. Soms verdwenen woorden gewoon toen je ze verzond, wat natuurlijk niet ideaal is. Dus hebben we dat opgelost en 20 andere tekstgerelateerde fouten, zoals het automatisch afspelen van GIF\'s in forums, en nu kun je daadwerkelijk tekst zoeken in een voicechat.\n\n**Gestroomlijnde streamermodus.** Als je de streamermodus inschakelt, worden nu zowel gebruikersprofielen als serverprofielen verborgen, zodat je alle aandacht kunt besteden aan je aanbiddende fans. We vinden het geweldig dat je van je gezicht houdt en voor de camera gaan is geweldig, vooral nu we een aantal bugs hebben verholpen met de machtigingen voor cameravoorbeelden.\n\n**Discord go brrrr.** We hebben behoefte aan snelheid, dus hebben we de app sneller gemaakt tijdens het openen en kun je nu in recordtijd meer dingen doen die je leuk vindt.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "pl"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNowy Rok, Więcej Ataków na Bugi {added marginTop}\n======================\n\nTo była noc przed Nowym Rokiem i przez cały dom Discord wszystkie stworzenia się poruszały, a te stworzenia były robakami. Poezja nie jest naszą specjalnością, ale zwalczanie błędów już tak. Wchodzimy w Nowy Rok z eksterminacją około 100 robaków Discorda, z tym co nazywamy Great Discord Bug Bash!\n\n**Rozjaśnione lekkie błędy.** Rzućmy nieco światła na to, jak rozjaśniliśmy Jasny Motyw. W świetle pewnych odkryć, takich jak ciemna plama tutaj lub niewłaściwy kolor ikony tam, postanowiliśmy to naprawić i dodać trochę światła do Jasnego Motywu. To powinno rozgorzeć wielką debatę o tym, który z Motywów jest lepszy.\n\n**Mniej bałaganu na czacie tekstowym.** Wumpus i ekipa rozwiązali zagadkę brakujących słów. Czasami słowa po prostu znikały kiedy je wysyłałeś, co oczywiście nie jest idealne. Naprawiliśmy więc ten i 20 innych błędów związanych z tekstem, takich jak poprawne automatyczne odtwarzanie GIF-ów na forach. Co więcej, możesz już wyszukiwać tekst na czacie głosowym.\n\n**Uproszczony Tryb Streamera.** włączenie trybu streamera powoduje teraz ukrycie zarówno profili użytkowników, jak i profili serwera, dzięki czemu możesz poświęcić całą uwagę swoim fanom. Cieszymy się, że uwielbiasz swoją twarz, a występowanie przed kamerą jest świetne - zwłaszcza teraz, gdy naprawiliśmy kilka błędów związanych z uprawnieniami do podglądu kamery.\n\n**Discord go brrrr.** Potrzebujemy prędkości, dlatego przyspieszyliśmy otwieranie aplikacji i teraz możesz uzyskać dostęp do większej ilości rzeczy, które lubisz w rekordowym czasie.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "ru"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nНовый Год, больше устранения багов {added marginTop}\n======================\n\nВ ночь накануне Нового Года в доме Discord пробудились все существа, именуемые багами. Поэзия - не наша специальность, но мы мастера устранения багов. Новый год начинается с устранения около 100 багов Discord, назовем это Великой Битвой Discord против Багов!\n\n**Освещая баги.** Давайте прольем немного света на то, как мы улучшили светлую тему. В свете некоторых открытий, например появления темных элементов в определенных местах или использование неправильной иконки, мы решили все исправить и принести больше света в светлую тему. Этот луч света вновь пробудит споры о том, какая тема лучше. \n\n**Меньше путаницы в текстовом чате.** Вампус и команда разгадали тайну пропавших слов. Иногда слова пропадают, когда вы отправляете их, что, конечно, не пример идеальной работы. Мы исправили это и устранили 20 других багов, связанных с текстом. В частности теперь GIF-файлы автоматически корректно воспроизводятся на форумах, также теперь можно искать текст в голосовом чате. \n\n**Усовершенствованный Режим Стримера.** Включение Режима Стримера теперь приведет к тому, что профиль пользователя и профили на серверах будут скрыты. Это сделано, чтобы вы могли уделить максимум внимания своим преданным фанатам. Мы рады, когда вам нравится ваше лицо, и выводить его на камеру - это прекрасно, особенно теперь, когда мы исправили некоторые баги с разрешениями предварительного просмотра камеры. \n\n**Discord делает вжух.** Мы хотим скорости, поэтому мы ускорили запуск приложения и теперь вы можете получить доступ к ваших любимым вещам в рекордные сроки.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "sv-SE"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nNytt år, mer fellösning {added marginTop}\n======================\n\nDet var kvällen då det nya året skulle ringas in och överallt i Discord-huset yrade en massa varelser omkring – dessa varelser var buggar. Poesi är inte riktigt vår grej, men det är däremot fellösning. Vi ringer in det nya året med utplåningen av cirka 100 Discord-fel, något som vi kallar Discords stora Bug Bash! \n\n**Upplysta ljusfel** Låt oss rikta strålkastaren på hur vi lyst upp de Ljusa temat. I ljuset av nya upptäckter, såsom en mörk flack här eller fel ikonfärg där, bestämde vi oss för att fixa dessa och skapa lite mer ljus i vårt Ljusa tema. Detta bör nog göra den stora debatten om vilket tema som är bäst mer upplyst. \n\n**Mindre oreda I textchatten** Wumpus och gänget löste mysteriet med de försvunna orden. Ibland kunde ord bara försvinna, vilket givetvis är allt annat än perfekt. Så vi löste detta, samt 20 andra textrelaterade fel, t.ex. att GIFar spelas upp automatiskt på korrekt sätt i forum och att du nu faktiskt kan söka efter text i en röstchatt. \n\n**Strömlinjeformat Streamerläge.** När du aktiverar Streamerläge döljs numera både din Användarprofil och Serverprofil så att du kan ge full uppmärksamhet åt dina kära fans. Vi älskar att du älskar dina fans, och det är underbart härligt att sitta framför kameran – särskilt nu när vi har löst några fel med behörigheterna gällande förhandsgranskning av kameran. \n\n**Discord växlar upp.** We’ve got a need, a need for speed, så vi har gjort appen snabbare och nu kan du får mer av sakerna du gillar på rekordtid.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "tr"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nYeni Yıl, Daha Fazla Böcek Ezme {added marginTop}\n======================\n\nYılbaşından önceki geceydi ve Discord evindeki tüm yaratıklar kıpır kıpırdı ve bu yaratıklar böceklerdi. Şiir bizim uzmanlık alanımız değil, ama böcek ezmek öyle. Yeni yıla yaklaşık 100 Discord böceğinin imhasıyla giriyoruz ve buna Büyük Discord Böcek Baskını adını veriyoruz!\n\n**Aydınlatılmış Işık böcekleri.** Açık Temayı nasıl aydınlattığımıza biraz ışık tutalım. Buradaki karanlık nokta veya yanlış simge rengi gibi bazı keşiflerin ışığında, bunları düzeltmeye ve Açık Tema\'ya biraz daha ışık getirmeye karar verdik. Bu, hangi temanın daha iyi olduğu konusundaki büyük tartışmayı aydınlatacaktır.\n\n**Daha az karışık metin sohbeti.** Wumpus ve ekibi kayıp kelimelerin gizemini çözdü. Bazen kelimeler onları gönderdiğinizde kaybolur, ki bu elbette ideal değildir. Bu nedenle, bunu ve forumlarda otomatik olarak oynatılan GIF\'ler gibi metinle ilgili diğer 20 hatayı düzelttik ve artık sesli sohbette gerçekten metin arayabileceksin.\n\n**Kolaylaştırılmış Yayıncı Modu.** Yayıncı Modu\'nu açmak artık hem Kullanıcı Profillerini hem de Sunucu Profillerini gizliyor. Böylece tüm dikkatini sevgi dolu hayranlarına verebilirsin. Yüzünüzü sevmeni seviyoruz ve özellikle kamera ön izleme izinleriyle ilgili bazı hataları düzelttikten sonra kameraya çıkmak harika olacaktır.\n\n**Discord uçuyor.** Hıza ihtiyacımız var ve bu yüzden uygulamanın daha hızlı açılmasını sağladık. Artık sevdiğiniz daha fazla şeye rekor sürede ulaşabilirsin.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "zh-CN"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\n新年灭 bug 计画 {added marginTop}\n======================\n\n大年夜当晚，我们发现所有在 Discord 之家的生物都在蠢蠢欲动，并且这些生物是一窝 bug。虽说我们没有唐伯虎般的诗情画意，但是我们最拿手的就是扑灭 bug。新的一年刚开始，我们已经扑灭了为数100多个的 bug，我们将此称之为“Discord 的伟大 bug 扑灭企划”!\n\n**点灯找出 bug： ** 让我们以明亮主题作为范例。比如，我们收到许多像是这里有个地方好暗，那里的图示颜色不对等等的意见，我们决定修复这些 bug 让明亮主题看起来更棒。这应该会诱发大家在针对要使用哪个主题上进行一场大规模的辩论。\n\n**不凌乱的文字聊天： ** Wumpus 跟他的好伙伴们一起解决了文字丢失之谜。有时候文字在您寄出时突然消失，这当然不是一个理想的状况。因此我们修复了这个问题以及其他20个与文字相关的错误，例如动态GIF现在已经可以在论坛中正确自动播放，并且您可以实际在语音聊天中搜寻文字。\n\n**直播模式：** 现在打开直播模式的同时将会自动隐藏使用者个人信息以及伺服器个人信息，因此您可以全神贯注在您最爱的粉丝身上。我们最乐于见到的就是看到您的面貌完美无瑕的呈现在相机中，特别是我们最近刚刚修复了一些相机预览权限上的 bug。\n\n**Discord 超速了： ** 我们听到您的呼唤，告诉我们您有速度上的需求，所以我们把应用程序的开启时间更加缩短，现在您可以以破纪录的时间完成更多想做的事。\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "zh-TW"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\n新年 bug 撲滅計畫 {added marginTop}\n======================\n\n除夕當晚，我們發現所有在 Discord 之家的生物都在蠢蠢欲動，並且這些生物都是 bug。雖然我們沒有唐伯虎般的詩情畫意，但是我們最拿手的就是撲滅 bug。新的一年剛開始，我們已經撲滅了為數100多個的 bug，我們將此稱之為「Discord 的偉大 bug 撲滅計畫」!\n\n**點燈找出 bug：** 讓我們以明亮主題作為範例。比如，我們收到許多像是這裡有個地方好暗，那裡的圖示顏色不對等等的意見，我們決定修復這些 bug 讓明亮主題看起來更棒。這應該會誘發大家在針對要使用哪個主題上進行一場大規模的辯論。\n\n**不凌亂的文字聊天：** Wumpus 跟他的好夥伴們一起解決了文字走丟的謎團。有時候文字在您寄出時突然消失，這當然不是一個理想的狀況。因此我們修復了這個問題以及其他20個與文字相關的錯誤，例如動態GIF現在已經可以在論壇中正確自動播放，並且您可以實際在語音聊天中搜尋文字。\n\n**直播模式：** 現在在打開直播模式的同時將會自動隱藏使用者個人資料以及伺服器個人資料，因此您可以全神貫注在您最愛的粉絲身上。 我們最樂於見到的就是看到您的面貌完美無瑕的呈現在相機中，特別是我們最近剛剛修復了一些相機預覽權限上的 bug。 \n\n**Discord 超速了：** 我們聽到您的呼喚，告訴我們您有速度上的需求，所以我們把應用程式的開啟時間更加縮短，現在您可以以破紀錄的時間完成更多想做的事。\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "pt-BR"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\nAno Novo, Mais Caça aos Bugs {added marginTop}\n======================\n\nEra a noite da véspera de Ano Novo, e por toda a casa do Discord todas as criaturas estavam buliçosas, e essas criaturas eram bugs. Poesia não é nossa especialidade, mas esmagar bugs é. Estamos saudando o ano novo com o extermínio de aproximadamente 100 bugs no Discord, com o que estamos chamando de o Grande Extermínio de Bugs do Discord!\n\n**Bugs-Vagalumes Iluminados.** Vamos trazer à luz a forma como iluminamos o Modo Claro. À luz de novas descobertas, como um canto escuro aqui ou uma cor de ícone errada ali, decidimos corrigi-las e trazer mais claridade ao Modo Claro. Isso deve esclarecer o grande debate sobre qual tema é melhor.\n\n**Chat de texto menos bagunçado.** O Wumpus e sua turma resolveram o mistério das palavras desaparecidas. Às vezes as palavras simplesmente desapareciam ao ser enviadas, o que claramente está longe do ideal. Então resolvemos esse e outros 20 erros relacionados a texto, como GIFs agora reproduzindo corretamente em fóruns, e agora você pode realmente procurar por texto em um canal de voz.\n\n**Modo Streamer Simplificado.** Ligar o Modo Streamer agora esconde tanto Perfis de Usuário quanto Perfis de Servidor, para que você possa dar toda a sua atenção aos seus fãs apaixonados. Nós adoramos que você adore seu próprio rosto, e ligar a câmera é ótimo, especialmente agora que corrigimos alguns bugs com as permissões de prévia da câmera.\n\n**Discord faz brrrr.** Temos uma necessidade, uma necessidade por velocidade. Então fizemos com que o app abrisse mais rapidamente, e agora você pode acessar mais coisas que gosta em tempo recorde.\n\n\n---changelog---\ndate: "2023-01-25"\nlocale: "ko"\nimage: "https://cdn.discordapp.com/attachments/1062143703831031818/1063529406334763079/Screen_Shot_2023-01-13_at_10.46.05_AM.png"\n---\n새해, 더 많은 버그 배싱 {added marginTop}\n======================\n\n새해 전날 밤, Discord 하우스 전체에서 모든 생물이 움직이고 있었고 그 생물은 벌레였습니다. 시는 우리 전문 분야가 아니지만 버그 배싱은 전문 분야입니다. 우리는 Great Discord Bug Bash라고 부르는 약 100개의 Discord 버그 박멸과 함께 새해를 맞이하고 있습니다!\n\n**라이트 버그를 밝게 했습니다:** 라이트 테마를 어떻게 밝게 했는지 살펴보겠습니다. 어두운 점이나 잘못된 아이콘 색상과 같은 일부 문제를 근거로 이를 수정하고 밝은 테마에 더 많은 빛을 추가하기로 결정했습니다. 어떤 테마가 더 나은지에 대한 위대한 논쟁을 계몽해야 합니다.\n\n**문자 채팅을 부분 수정하였습니다:** Wumpus와 갱단은 누락된 단어의 수수께끼를 풀었습니다. 때로는 단어를 보내면 단어가 사라지는데, 이는 이상적이지 않습니다. 그래서 포럼에서 올바르게 자동 재생되는 GIF와 같은 20개의 다른 텍스트 관련 오류를 수정했으며 이제 음성 채팅에서 실제로 텍스트를 검색할 수 있습니다.\n\n**간소화된 스트리머 모드:** 이제 스트리머 모드를 켜면 사용자 프로필과 서버 프로필이 모두 숨겨지므로 열성 팬에게 집중할 수 있습니다. 우리는 당신이 당신의 얼굴을 사랑하고 카메라를 사용하는 것이 훌륭하다는 것을 기쁘게 생각합니다. 특히 이제 카메라 미리보기 권한과 관련된 일부 버그를 수정했습니다.\n\n**Discord go brrrr:** 우리는 앱을 더 빨리 열 수 있도록 속도를 향상시킬 필요성이 있었습니다. 이제 시간 내에 원하는 항목을 더 많이 얻을 수 있습니다.\n\n\n'
